import { getCategory } from "../utils/cropCategories";

function CategoryList({ data, category }) {

  const filtered = data.filter(item => {
    const cropName =
      item.Commodity ||
      item.commodity ||
      item.Crop ||
      item.crop_name;

    return getCategory(cropName) === category;
  });

  console.log(`ðŸ“‹ ${category} items:`, filtered.length);

  if (!filtered.length) {
    return (
      <h3 style={{ padding: "20px" }}>
        No data found for {category}
      </h3>
    );
  }

  return (
    <div style={{ padding: "20px" }}>
      <h2>{category} List</h2>

      <table border="1" width="100%" cellPadding="8">
        <thead>
          <tr>
            <th>Commodity</th>
            <th>Market</th>
            <th>State</th>
            <th>Modal Price (â‚¹)</th>
          </tr>
        </thead>

        <tbody>
          {filtered.map((item, index) => (
            <tr key={index}>
              <td>{item.Commodity}</td>
              <td>{item.Market}</td>
              <td>{item.State}</td>
              <td>{item.Modal_x0020_Price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CategoryList;
